import styled from "styled-components";


const Hex = styled.polygon`
cursor: pointer;
fill-opacity: 0.4;
stroke: #000;
stroke-width: 1;
transition: transform, fill-opacity, stroke-width;
-webkit-transition: transform, fill-opacity, stroke-width;
transition-duration: 1s;
-webkit-transition-duration: 1s;
transform: rotate(30deg);
fill: #ffff00;
&:hover{
  fill-opacity: 1;
  stroke: #ff0000;
  stroke-width: 5;
}
`


export function HexComponent() {

  return (
    <svg height="300" width="100%">
        <Hex points="300,150 225,280 75,280 0,150 75,20 225,20">test</Hex>
    </svg>
  );
}
